import React from 'react';
import ButtonsHomeView from '../../components/buttons/ButtonsHomeView';
import './HomeView.css';

function HomeView() {
  return (
    <div className='backgroundImage'>
      <div className='Text'>
        <div className='Title'>
          <h1>
            TeamUp
          </h1>
        </div>
        <div className='subtitle'>
          <h3>
            Are you ready for this new experience?
          </h3>
        </div>
        <div className='ContainerButtons'>
          <ButtonsHomeView name='Busco equipo' onClick={console.log("hola")}/>
          <ButtonsHomeView name='Arriendo mi Cancha' onClick={'#home'} />
        </div>
      </div>
    </div>
  )
}

export default HomeView;
